    - type: Paper
      content: >+
        Объект №: ACO-999-FAL


        Название объекта:

        Щекоточный монстр

        Класс объекта: Безопасный

        Статус объекта: На содержании


        Особые условия содержания: ACO-999 дозволяется свободно бродить по территории комплекса, если оно того пожелает. В остальных случаях необходимо держать его внутри загончика с 20:00 до 21:00 или во время блокировки всей Зоны ради безопасности существа. Существу не разрешается выходить из загончика ночью или покидать территорию комплекса. Загончик всегда должен быть чист, еду следует приносить дважды в день. В зону содержания ACO-999 разрешено входить всем сотрудникам, но только если в это время у них нет других дел или если у них перерыв. С существом следует играть, когда ему скучно, говорить с ним нужно спокойным голосом, избегая угрожающего тона.


        Описание: ACO-999 выглядит как большая аморфная студенистая масса прозрачной оранжевой слизи, весящая приблизительно 54 кг (120 фунтов) и обладающая вязкостью как у арахисового масла. Размер существа и его форма легко изменяются, хотя в состоянии покоя оно принимает форму приплюснутой полусферы шириной 2 м и высотой 1 м. Поверхность ACO-999 покрыта тонкой прозрачной мембраной, как у животных клеток, толщиной примерно 0,5 см. Эта мембрана обладает чрезвычайной эластичностью, что позволяет ACO-999 сплющиваться до толщины в 2 см. И хотя поверхность тела существа обладает свойством гидрофобности, оно способно поглощать жидкости. Все тело существа состоит из вязкого оранжевого вещества, химический состав вещества, из которого состоит ACO-999, неизвестен, однако в нём легко могут перевариваться органические соединения.

